    "            for current_word in current_sent:\n",
    "                word_counter += 1\n",
    "                if len(temp)==0:\n",
    "                    temp = np.array(list(model.wv[current_word]))\n",
    "                else:\n",
    "                    temp += np.array(list(model.wv[current_word]))\n",
    "\n",
